import React from 'react';
import { Box, Container, Grid, Typography, Button, styled } from '@mui/material';
import { Link } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { logout } from '../actions'; // Replace with your actual path

// Styled Components for better styling control
const WelcomeBox = styled(Box)(({ theme }) => ({
  padding: theme.spacing(4),
  backgroundColor: 'white',
  borderRadius: theme.spacing(1),
  boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
  textAlign: 'center', // Center text within the box
}));

const FeatureBox = styled(Box)(({ theme }) => ({
  padding: theme.spacing(4),
  backgroundColor: 'white',
  borderRadius: theme.spacing(1),
  boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'flex-start', // Align items to the start (left)
  justifyContent: 'center',
}));

const StyledButton = styled(Button)(({ theme, color = "primary" }) => ({
  padding: theme.spacing(1.5, 3), // Adjusted padding
  borderRadius: '8px',
  fontSize: '16px',
  width: '200px',
  textAlign: 'center',
  ...(color === "error" && { // Conditional styling for error color
    backgroundColor: theme.palette.error.main,
    '&:hover': {
      backgroundColor: theme.palette.error.dark,
    },
  }),
}));




const Home = () => {
  const user = useSelector((state) => state.user);
  const dispatch = useDispatch();

  const handleLogout = () => {
    dispatch(logout());
  };

  return (
    <Box sx={{ mt: 10, bgcolor: '#f5f5f5', py: 8 }}>
      <Container maxWidth="lg">
        <Grid container spacing={4} justifyContent="center">

          {/* Welcome Section */}
          <Grid item xs={12} sm={8} md={6}>
            <WelcomeBox>
              <Typography variant="h4" component="h1" gutterBottom sx={{ fontWeight: 'bold', color: '#333' }}>
                Bienvenue au Tribunal de Commerce de Casablanca
              </Typography>
              <Typography variant="body1" color="text.secondary" paragraph sx={{ lineHeight: 1.6 }}>
                Application moderne et réactive pour la gestion du Tribunal de Commerce de Casablanca. Facilitant l'accès aux services et informations.
              </Typography>

              <Box sx={{ display: 'flex', justifyContent: 'center', mt: 2 }}>
                {user ? (
                  <StyledButton variant="contained" color="error" onClick={handleLogout}>
                    Se Déconnecter
                  </StyledButton>
                ) : (
                  <Link to="/login" style={{ textDecoration: 'none' }}>
                    <StyledButton variant="contained" color="primary">
                      Se Connecter
                    </StyledButton>
                  </Link>
                )}
              </Box>
            </WelcomeBox>
          </Grid>

          {/* Features Section */}
          <Grid item xs={12} sm={8} md={6}>
            <FeatureBox>
              <Typography variant="h5" component="h2" gutterBottom sx={{ fontWeight: 'bold', color: '#333' }}>
                Fonctionnalités
              </Typography>
              <Typography variant="body1" color="text.secondary" paragraph>
                Gestion des utilisateurs
              </Typography>
              <Typography variant="body1" color="text.secondary" paragraph>
                Gestion des réservations
              </Typography>
              <Typography variant="body1" color="text.secondary" paragraph>
                Gestion des départements
              </Typography>
            </FeatureBox>
          </Grid>

          {/* Benefits Section */}
          <Grid item xs={12} sm={8} md={6}>
            <FeatureBox>
              <Typography variant="h5" component="h2" gutterBottom sx={{ fontWeight: 'bold', color: '#333' }}>
                Avantages
              </Typography>
              <Typography variant="body1" color="text.secondary" paragraph>
                Facile à utiliser
              </Typography>
              <Typography variant="body1" color="text.secondary" paragraph>
                Conception réactive
              </Typography>
              <Typography variant="body1" color="text.secondary" paragraph>
                Sécurisé
              </Typography>
            </FeatureBox>
          </Grid>

        </Grid>
      </Container>
    </Box>
  );
};

export default Home;
